import "../../Css/Header.css"
import { Link } from "react-router-dom";
// import ejobs from '../../images/ejobs.png'

function Header() {

//      const  handleScroll = e => {
//     e.preventDefault();
//     window.scrollTo({
//         top: 400,
//         left: 0,
//         behavior: "tr"
//     });
// };


    return (
        <div className="header">
         <Link to="/" style={{textDecoration:0}}>
                 <div className="landingEjobs">
                         <h1>eJobs</h1>
                        {/* <img src={ejobs} alt="ejobs"/> */}
                      
                  </div>
         </Link>

         <div className="accountNav">
     
                {/* <h5 onClick={handleScroll}>How it works</h5> */}
<Link onClick={this.handleScroll}
        to="about"
        activeClass="active"
        spy={true} 
        smooth={true}
    >
               <h5>How it works</h5>
    </Link>
                <Link to="/login" style={{textDecoration:0}}>
                        <button className="loginBtn">Login</button>
                </Link>
                <Link to="/register" style={{textDecoration:0}}>
                        <button className="registerBtn">Register</button>
                </Link>      
         </div>
        </div>
    )
}

export default Header
